using ObjectiveC;using System;using SwiftSharp.Attributes;using Foundation;namespace UIKit{	//https://developer.apple.com/library/prerelease/ios/documentation/UIKit/Reference/UITableViewDelegate_Protocol/index.html#//apple_ref/occ/intf/UITableViewDelegate	/// <summary>	/// The delegate of a UITableView object must adopt the UITableViewDelegate protocol. Optional methods of the protocol allow the delegate to manage selections, configure section headings and footers, help to delete and reorder cells, and perform other actions.	/// </summary>	[iOSVersion(2)]	public interface UITableViewDelegate	{		/// <summary>		/// Asks the delegate for the height to use for a row in a specified location.		/// </summary>		/// <param name="tableView">The table-view object requesting this information.</param>		/// <param name="heightForRowAtIndexPath">An index path that locates a row in tableView.</param>		/// <returns>A nonnegative floating-point value that specifies the height (in points) that row should be.</returns>		[iOSVersion(2)]		[Export("tableView")]		[Optional]		CGFloat TableView(UITableView tableView, NSIndexPath heightForRowAtIndexPath);				/// <summary>		/// Asks the delegate for the estimated height of a row in a specified location.		/// </summary>		/// <param name="tableView">The table-view object requesting this information.</param>		/// <param name="estimatedHeightForRowAtIndexPath">An index path that locates a row in tableView.</param>		/// <returns>A nonnegative floating-point value that estimates the height (in points) that row should be. Return UITableViewAutomaticDimension if you have no estimate.</returns>		[iOSVersion(7)]		[Export("tableView")]		[Optional]		CGFloat TableView(UITableView tableView, NSIndexPath estimatedHeightForRowAtIndexPath);				/// <summary>		/// Asks the delegate to return the level of indentation for a row in a given section.		/// </summary>		/// <param name="tableView">The table-view object requesting this information.</param>		/// <param name="indentationLevelForRowAtIndexPath">An index path locating the row in tableView.</param>		/// <returns>Returns the depth of the specified row to show its hierarchical position in the section.</returns>		[iOSVersion(2)]		[Export("tableView")]		[Optional]		int TableView(UITableView tableView, NSIndexPath indentationLevelForRowAtIndexPath);				/// <summary>		/// Tells the delegate the table view is about to draw a cell for a particular row.		/// </summary>		/// <param name="tableView">The table-view object informing the delegate of this impending event.</param>		/// <param name="willDisplayCell">A table-view cell object that tableView is going to use when drawing the row.</param>		/// <param name="forRowAtIndexPath">An index path locating the row in tableView.</param>		[iOSVersion(2)]		[Export("tableView")]		[Optional]		void TableView(UITableView tableView, UITableViewCell willDisplayCell, NSIndexPath forRowAtIndexPath);				/// <summary>		/// Asks the delegate for the type of standard accessory view to use as a disclosure control for the specified row.				 		  Deprecation Statement		  		 Use the accessory-view and accessory-type properties (for both normal and editing modes) of the UITableViewCell class when configuring table-view cells.		/// </summary>		/// <param name="tableView">The table-view object requesting the accessory-view type.</param>		/// <param name="accessoryTypeForRowWithIndexPath">An index path locating the row in tableView.</param>		/// <returns>A constant identifying a type of standard accessory view. For details, see the &quot;Constants” section in UITableViewCell Class Reference.</returns>		[Obsolete]		[iOSVersion(2)]		[Export("tableView")]		[Optional]		UITableViewCellAccessoryType TableView(UITableView tableView, NSIndexPath accessoryTypeForRowWithIndexPath);				/// <summary>		/// Tells the delegate that the user tapped the accessory (disclosure) view associated with a given row.		/// </summary>		/// <param name="tableView">The table-view object informing the delegate of this event.</param>		/// <param name="accessoryButtonTappedForRowWithIndexPath">An index path locating the row in tableView.</param>		[iOSVersion(2)]		[Export("tableView")]		[Optional]		void TableView(UITableView tableView, NSIndexPath accessoryButtonTappedForRowWithIndexPath);				/// <summary>		/// Tells the delegate that a specified row is about to be selected.		/// </summary>		/// <param name="tableView">A table-view object informing the delegate about the impending selection.</param>		/// <param name="willSelectRowAtIndexPath">An index path locating the row in tableView.</param>		/// <returns>An index-path object that confirms or alters the selected row. Return an NSIndexPath object other than indexPath if you want another cell to be selected. Return nil if you don't want the row selected.</returns>		[iOSVersion(2)]		[Export("tableView")]		[Optional]		NSIndexPath TableView(UITableView tableView, NSIndexPath willSelectRowAtIndexPath);				/// <summary>		/// Tells the delegate that the specified row is now selected.		/// </summary>		/// <param name="tableView">A table-view object informing the delegate about the new row selection.</param>		/// <param name="didSelectRowAtIndexPath">An index path locating the new selected row in tableView.</param>		[iOSVersion(2)]		[Export("tableView")]		[Optional]		void TableView(UITableView tableView, NSIndexPath didSelectRowAtIndexPath);				/// <summary>		/// Tells the delegate that a specified row is about to be deselected.		/// </summary>		/// <param name="tableView">A table-view object informing the delegate about the impending deselection.</param>		/// <param name="willDeselectRowAtIndexPath">An index path locating the row in tableView to be deselected.</param>		/// <returns>An index-path object that confirms or alters the deselected row. Return an NSIndexPath object other than indexPath if you want another cell to be deselected. Return nil if you don’t want the row deselected.</returns>		[iOSVersion(3)]		[Export("tableView")]		[Optional]		NSIndexPath TableView(UITableView tableView, NSIndexPath willDeselectRowAtIndexPath);				/// <summary>		/// Tells the delegate that the specified row is now deselected.		/// </summary>		/// <param name="tableView">A table-view object informing the delegate about the row deselection.</param>		/// <param name="didDeselectRowAtIndexPath">An index path locating the deselected row in tableView.</param>		[iOSVersion(3)]		[Export("tableView")]		[Optional]		void TableView(UITableView tableView, NSIndexPath didDeselectRowAtIndexPath);				/// <summary>		/// Asks the delegate for a view object to display in the header of the specified section of the table view.		/// </summary>		/// <param name="tableView">The table-view object asking for the view object.</param>		/// <param name="viewForHeaderInSection">An index number identifying a section of tableView .</param>		/// <returns>A view object to be displayed in the header of section .</returns>		[iOSVersion(2)]		[Export("tableView")]		[Optional]		UIView TableView(UITableView tableView, int viewForHeaderInSection);				/// <summary>		/// Asks the delegate for a view object to display in the footer of the specified section of the table view.		/// </summary>		/// <param name="tableView">The table-view object asking for the view object.</param>		/// <param name="viewForFooterInSection">An index number identifying a section of tableView .</param>		/// <returns>A view object to be displayed in the footer of section .</returns>		[iOSVersion(2)]		[Export("tableView")]		[Optional]		UIView TableView(UITableView tableView, int viewForFooterInSection);				/// <summary>		/// Asks the delegate for the height to use for the header of a particular section.		/// </summary>		/// <param name="tableView">The table-view object requesting this information.</param>		/// <param name="heightForHeaderInSection">An index number identifying a section of tableView .</param>		/// <returns>A nonnegative floating-point value that specifies the height (in points) of the header for section.</returns>		[iOSVersion(2)]		[Export("tableView")]		[Optional]		CGFloat TableView(UITableView tableView, int heightForHeaderInSection);				/// <summary>		/// Asks the delegate for the estimated height of the header of a particular section.		/// </summary>		/// <param name="tableView">The table-view object requesting this information.</param>		/// <param name="estimatedHeightForHeaderInSection">An index number identifying a section of tableView .</param>		/// <returns>A nonnegative floating-point value that specifies the height (in points) of the header for section.</returns>		[iOSVersion(7)]		[Export("tableView")]		[Optional]		CGFloat TableView(UITableView tableView, int estimatedHeightForHeaderInSection);				/// <summary>		/// Asks the delegate for the height to use for the footer of a particular section.		/// </summary>		/// <param name="tableView">The table-view object requesting this information.</param>		/// <param name="heightForFooterInSection">An index number identifying a section of tableView .</param>		/// <returns>A nonnegative floating-point value that specifies the height (in points) of the footer for section.</returns>		[iOSVersion(2)]		[Export("tableView")]		[Optional]		CGFloat TableView(UITableView tableView, int heightForFooterInSection);				/// <summary>		/// Asks the delegate for the estimated height of the footer of a particular section.		/// </summary>		/// <param name="tableView">The table-view object requesting this information.</param>		/// <param name="estimatedHeightForFooterInSection">An index number identifying a section of tableView .</param>		/// <returns>A nonnegative floating-point value that estimates the height (in points) of the footer for section.</returns>		[iOSVersion(7)]		[Export("tableView")]		[Optional]		CGFloat TableView(UITableView tableView, int estimatedHeightForFooterInSection);				/// <summary>		/// Tells the delegate that a header view is about to be displayed for the specified section.		/// </summary>		/// <param name="tableView">The table-view object informing the delegate of this event.</param>		/// <param name="willDisplayHeaderView">The header view that is about to be displayed.</param>		/// <param name="forSection">An index number identifying a section of tableView.</param>		[iOSVersion(6)]		[Export("tableView")]		[Optional]		void TableView(UITableView tableView, UIView willDisplayHeaderView, int forSection);				/// <summary>		/// Tells the delegate that a footer view is about to be displayed for the specified section.		/// </summary>		/// <param name="tableView">The table-view object informing the delegate of this event.</param>		/// <param name="willDisplayFooterView">The footer view that is about to be displayed.</param>		/// <param name="forSection">An index number identifying a section of tableView .</param>		[iOSVersion(6)]		[Export("tableView")]		[Optional]		void TableView(UITableView tableView, UIView willDisplayFooterView, int forSection);				/// <summary>		/// Tells the delegate that the table view is about to go into editing mode.		/// </summary>		/// <param name="tableView">The table-view object providing this information.</param>		/// <param name="willBeginEditingRowAtIndexPath">An index path locating the row in tableView.</param>		[iOSVersion(2)]		[Export("tableView")]		[Optional]		void TableView(UITableView tableView, NSIndexPath willBeginEditingRowAtIndexPath);				/// <summary>		/// Tells the delegate that the table view has left editing mode.		/// </summary>		/// <param name="tableView">The table-view object providing this information.</param>		/// <param name="didEndEditingRowAtIndexPath">An index path locating the row in tableView.</param>		[iOSVersion(2)]		[Export("tableView")]		[Optional]		void TableView(UITableView tableView, NSIndexPath didEndEditingRowAtIndexPath);				/// <summary>		/// Asks the delegate for the editing style of a row at a particular location in a table view.		/// </summary>		/// <param name="tableView">The table-view object requesting this information.</param>		/// <param name="editingStyleForRowAtIndexPath">An index path locating a row in tableView.</param>		/// <returns>The editing style of the cell for the row identified by indexPath.</returns>		[iOSVersion(2)]		[Export("tableView")]		[Optional]		UITableViewCellEditingStyle TableView(UITableView tableView, NSIndexPath editingStyleForRowAtIndexPath);				/// <summary>		/// Changes the default title of the delete-confirmation button.		/// </summary>		/// <param name="tableView">The table-view object requesting this information.</param>		/// <param name="titleForDeleteConfirmationButtonForRowAtIndexPath">An index-path object locating the row in its section.</param>		/// <returns>A localized string to used as the title of the delete-confirmation button.</returns>		[iOSVersion(3)]		[Export("tableView")]		[Optional]		string TableView(UITableView tableView, NSIndexPath titleForDeleteConfirmationButtonForRowAtIndexPath);				/// <summary>		/// Asks the delegate whether the background of the specified row should be indented while the table view is in editing mode.		/// </summary>		/// <param name="tableView">The table-view object requesting this information.</param>		/// <param name="shouldIndentWhileEditingRowAtIndexPath">An index-path object locating the row in its section.</param>		/// <returns>true if the background of the row should be indented, otherwise false.</returns>		[iOSVersion(2)]		[Export("tableView")]		[Optional]		bool TableView(UITableView tableView, NSIndexPath shouldIndentWhileEditingRowAtIndexPath);				/// <summary>		/// Asks the delegate to return a new index path to retarget a proposed move of a row.		/// </summary>		/// <param name="tableView">The table-view object that is requesting this information.</param>		/// <param name="targetIndexPathForMoveFromRowAtIndexPath">An index-path object identifying the original location of a row (in its section) that is being dragged.</param>		/// <param name="toProposedIndexPath">An index-path object identifying the currently proposed destination of the row being dragged.</param>		/// <returns>An index-path object locating the desired row destination for the move operation. Return proposedDestinationIndexPath if that location is suitable.</returns>		[iOSVersion(2)]		[Export("tableView")]		[Optional]		NSIndexPath TableView(UITableView tableView, NSIndexPath targetIndexPathForMoveFromRowAtIndexPath, NSIndexPath toProposedIndexPath);				/// <summary>		/// Tells the delegate that the specified cell was removed from the table.		/// </summary>		/// <param name="tableView">The table-view object that removed the view.</param>		/// <param name="didEndDisplayingCell">The cell that was removed.</param>		/// <param name="forRowAtIndexPath">The index path of the cell.</param>		[iOSVersion(6)]		[Export("tableView")]		[Optional]		void TableView(UITableView tableView, UITableViewCell didEndDisplayingCell, NSIndexPath forRowAtIndexPath);				/// <summary>		/// Tells the delegate that the specified header view was removed from the table.		/// </summary>		/// <param name="tableView">The table-view object that removed the view.</param>		/// <param name="didEndDisplayingHeaderView">The header view that was removed.</param>		/// <param name="forSection">The index of the section that contained the header.</param>		[iOSVersion(6)]		[Export("tableView")]		[Optional]		void TableView(UITableView tableView, UIView didEndDisplayingHeaderView, int forSection);				/// <summary>		/// Tells the delegate that the specified footer view was removed from the table.		/// </summary>		/// <param name="tableView">The table-view object that removed the view.</param>		/// <param name="didEndDisplayingFooterView">The footer view that was removed.</param>		/// <param name="forSection">The index of the section that contained the footer.</param>		[iOSVersion(6)]		[Export("tableView")]		[Optional]		void TableView(UITableView tableView, UIView didEndDisplayingFooterView, int forSection);				/// <summary>		/// Asks the delegate if the editing menu should be shown for a certain row.		/// </summary>		/// <param name="tableView">The table-view object that is making this request.</param>		/// <param name="shouldShowMenuForRowAtIndexPath">An index-path object locating the row in its section.</param>		/// <returns>true if the editing menu should be shown positioned near the row and pointing to it, otherwise false. The default value is false.</returns>		[iOSVersion(5)]		[Export("tableView")]		[Optional]		bool TableView(UITableView tableView, NSIndexPath shouldShowMenuForRowAtIndexPath);				/// <summary>		/// Asks the delegate if the editing menu should omit the Copy or Paste command for a given row.		/// </summary>		/// <param name="tableView">The table-view object that is making this request.</param>		/// <param name="canPerformAction">A selector type identifying the copy: or paste: method of the UIResponderStandardEditActions informal protocol.</param>		/// <param name="forRowAtIndexPath">An index-path object locating the row in its section.</param>		/// <param name="withSender">The object that initially sent the copy: or paste: message. T</param>		/// <returns>true if the command corresponding to action should appear in the editing menu, otherwise false. The default value is false.</returns>		[iOSVersion(5)]		[Export("tableView")]		[Optional]		bool TableView(UITableView tableView, Selector canPerformAction, NSIndexPath forRowAtIndexPath, AnyObject withSender);				/// <summary>		/// Tells the delegate to perform a copy or paste operation on the content of a given row.		/// </summary>		/// <param name="tableView">The table-view object that is making this request.</param>		/// <param name="performAction">A selector type identifying the copy: or paste: method of the UIResponderStandardEditActions informal protocol.</param>		/// <param name="forRowAtIndexPath">An index-path object locating the row in its section.</param>		/// <param name="withSender">The object that initially sent the copy: or paste: message.</param>		[iOSVersion(5)]		[Export("tableView")]		[Optional]		void TableView(UITableView tableView, Selector performAction, NSIndexPath forRowAtIndexPath, AnyObject withSender);				/// <summary>		/// Asks the delegate if the specified row should be highlighted.		/// </summary>		/// <param name="tableView">The table-view object that is making this request.</param>		/// <param name="shouldHighlightRowAtIndexPath">The index path of the row being highlighted.</param>		/// <returns>true if the row should be highlighted or false if it should not.</returns>		[iOSVersion(6)]		[Export("tableView")]		[Optional]		bool TableView(UITableView tableView, NSIndexPath shouldHighlightRowAtIndexPath);				/// <summary>		/// Tells the delegate that the specified row was highlighted.		/// </summary>		/// <param name="tableView">The table-view object that highlighted the cell.</param>		/// <param name="didHighlightRowAtIndexPath">The index path of the row that was highlighted.</param>		[iOSVersion(6)]		[Export("tableView")]		[Optional]		void TableView(UITableView tableView, NSIndexPath didHighlightRowAtIndexPath);				/// <summary>		/// Tells the delegate that the highlight was removed from the row at the specified index path.		/// </summary>		/// <param name="tableView">The table-view object that removed the highlight from the cell.</param>		/// <param name="didUnhighlightRowAtIndexPath">The index path of the row that had its highlight removed.</param>		[iOSVersion(6)]		[Export("tableView")]		[Optional]		void TableView(UITableView tableView, NSIndexPath didUnhighlightRowAtIndexPath);	}}